		public static Card[] Get(bool removeStamped = true)
		{
			/*if (removeStamped)
				return TheCards.Where(c => c.rarity != Rarity.Stamped).ToArray();
			
			return TheCards;*/
			
			return TheCards.Where(c => c.rarity != Rarity.Stamped).ToArray();
		}

		public static Card Find(Sets set, double setNum)
		{
			return TheCards.Where(c => c.set == set && c.setNum == setNum).First();
		}

		public static Card Find(Sets set, double setNum, Rarity rarity)
		{
			return TheCards.Where(c => c.set == set && c.setNum == setNum && c.rarity == rarity).First();
		}
		
		public static Card[] HasDuplicates()
		{
			int count = TheCards.Length;
			
			for (int i = 0; i < count; i++)
			{
				for (int j = 0; j < count; j++)
				{
					if (i != j && TheCards[i].IsEqualTo(TheCards[j]))
						return new Card[] { TheCards[i], TheCards[j] };
				}
			}
			
			return null;
		}
	}
